import React from "react";
import "../components/Navbar.css";
import Logo from "../images/logo.svg";
import Hero from "../images/desktop/image-hero.jpg";

const HelloWorld = () => {
  return (
    <nav>
      <header>
        <img src={Hero} alt="Hero" />
      </header>
      <img src={Logo} alt="Logo" />

      <ul>
        <li>
          <a href="">About</a>
        </li>
        <li>
          <a href="">Carrers</a>
        </li>
        <li>
          <a href="">Event</a>
        </li>
        <li>
          <a href="">Product</a>
        </li>
        <li>
          <a href="">Suport</a>
        </li>
      </ul>
    </nav>
  );
};

export default HelloWorld;
